    // 1. PARSE IMPORTED DATA TO KODAM MODEL STRUCTURE
    async function parseData(inventory){
        console.log('Model data loaded..') 	 	              
        return new Promise(function(resolve, reject){
            const modelOutputData = [inventory],		// Array of loaded data objects
                baselineInventoryIDX = 0,
                inventoryData = modelOutputData[baselineInventoryIDX].filter(d => d.stockID.slice(0,5).toUpperCase() === "STOCK")

            // a. Setup lists and variable defs
            Object.keys(inventoryData[0]).forEach((name) => {
                schema.defs.variables[name] = {
                    type:   modelOutputData[baselineInventoryIDX][0][name]
                }
                // i. Categorical type variable lists
                if(schema.defs.variables[name].type === "category" || schema.defs.variables[name].type === "sub-category" || schema.defs.variables[name].type === "meta-category" || schema.defs.variables[name].type === "cfg-option" ){
                    schema.list.stockMeta[name] = [...new Set(inventoryData.map(d => d[name]))].sort()
                }
                // ii. Setup mapping objects
                if(name === "emissionsSubSector_IPCC"){
                    schema.list.stockMeta[name].forEach(ipcc_subSector => schema.map.emissionsSubSectorType.ipcc_to_gpc[ipcc_subSector] = true ) 
                    schema.list.stockMeta[name].forEach(ipcc_subSector =>  schema.map.emissionsSubSectorToSector.ipcc[ipcc_subSector] = true ) 
                }
                if(name === "emissionsSubSector_GPC"){
                    schema.list.stockMeta[name].forEach(gpc_subSector =>  schema.map.emissionsSubSectorType.gpc_to_ipcc[gpc_subSector] = true ) 
                    schema.list.stockMeta[name].forEach(gpc_subSector =>  schema.map.emissionsSubSectorToSector.gpc[gpc_subSector] = true ) 
                }
                if(name === "economicSector"){
                    schema.list.stockMeta[name].forEach(economicSector =>  schema.map.economicSectorToGroup[economicSector] = true ) 
                }
                if(name === "economicSectorGroup"){
                    schema.list.stockMeta[name].forEach(economicSectorGroup =>  schema.map.economicGroup_sector_to_actor[economicSectorGroup] = true ) 
                }
                if(name === "economicActorGroup"){
                    schema.list.stockMeta[name].forEach(economicActorGroup =>  schema.map.economicGroup_actor_to_sector[economicActorGroup] = true ) 
                }
            })

            // b. Parse numbers and link mappings
            inventoryData.forEach( (d, i) => {
                d.emissions     =   +d.emissions
                d.emissionsAbated = +d.emissionsAbated
                d.energy        = +d.energy
                d.naturalVolume = +d.naturalVolume
                d.inBoundary    =  d.inBoundary === "TRUE" ? true : false
                // Mapping objects
                if(schema.map.economicSectorToGroup[d.economicSector]){
                    schema.map.economicSectorToGroup[d.economicSector] = d.economicSectorGroup
                }
                if(schema.map.emissionsSubSectorType.ipcc_to_gpc[d.emissionsSubSector_IPCC]){
                    schema.map.emissionsSubSectorType.ipcc_to_gpc[d.emissionsSubSector_IPCC] = d.emissionsSubSector_GPC
                }
                if(schema.map.emissionsSubSectorType.gpc_to_ipcc[d.emissionsSubSector_GPC]){
                    schema.map.emissionsSubSectorType.gpc_to_ipcc[d.emissionsSubSector_GPC] = d.emissionsSubSector_IPCC
                }
                if(schema.map.emissionsSubSectorToSector.ipcc[d.emissionsSubSector_IPCC]){
                    schema.map.emissionsSubSectorToSector.ipcc[d.emissionsSubSector_IPCC] = d.emissionsSector
                }
                if(schema.map.emissionsSubSectorToSector.gpc[d.emissionsSubSector_GPC]){
                    schema.map.emissionsSubSectorToSector.gpc[d.emissionsSubSector_GPC] = d.emissionsSector
                }
                if(schema.map.economicGroup_actor_to_sector[d.economicActorGroup]){
                    schema.map.economicGroup_actor_to_sector[d.economicActorGroup] = d.economicSectorGroup
                }
                if(schema.map.economicGroup_sector_to_actor[d.economicSectorGroup]){
                    schema.map.economicGroup_sector_to_actor[d.economicSectorGroup] = d.economicActorGroup
                }

            })

        // c. Nested hierarchies
            const emissionsNested = schema.nest.emissions.chain = d3.nest()
                .key( d => d.emissionsSector)
                .key( d => d.emissionsSubSector_IPCC)
                .key( d => d.siteOccupancy)
                .key( d => d.siteControl)
                .key( d => d.emissionsSource)
                .key( d => d.emissionsScope)
                .key( d => d.containerGroup)
                .key( d => d.containerClass)
                .key( d => d.containerSubClass)
                .key( d => d.container)
                .key( d => d.anchorClass)
                .key( d => d.activity)
                .entries(inventoryData);

            const economyNested =  schema.nest.economy.chain = d3.nest()
                .key( d => d.economicSectorGroup)
                .key( d => d.economicActorGroup)
                .key( d => d.siteOccupancy)
                .key( d => d.siteControl)
                .key( d => d.containerGroup)
                .key( d => d.containerClass)
                .key( d => d.containerSubClass)
                .key( d => d.container)
                .key( d => d.anchorClass)
                .key( d => d.emissionsSource)
                .key( d => d.emissionsScope)
                .key( d => d.activity)
                .entries(inventoryData);


            schema.nest.emissions.chain = emissionsNested.map( d => {
                return { [d.key]: d.values.map( d => {       // emissionsSector
                    return { [d.key] : d.values.map( d => {     // emissionsSubSector_IPCC
                        return { [d.key] : d.values.map( d => {    // siteOccupancy
                            return { [d.key] : d.values.map( d => {     // siteControl
                                return { [d.key] : d.values.map( d => {     // emissionsSource
                                    return { [d.key] : d.values.map( d => {     // emissionsScope
                                        return { [d.key] : d.values.map( d => {      // containerGroup
                                            return { [d.key] : d.values.map( d => {      // containerGroupClass 
                                                return { [d.key] : d.values.map( d => {      // containerSubClass 
                                                    return { [d.key] : d.values.map( d => {      // container 
                                                        return { [d.key] : d.values.map( d => {      // anchorClass 
                                                            return { [d.key] : d.values.map( d => {      // anchorClass 
                                                                // return { [d.key] : d.value }              // activity
                                                            }) }
                                                        }) }
                                                    }) }
                                                }) }
                                            }) }
                                        }) }
                                    }) }
                                }) }
                            }) }
                        }) }
                    }) }
                }) } 
            }) 


        // Store 
            model.inventory.baseline = inventoryData

            // console.log(inventoryData)
            // console.log(schema)

            // h. Return empty resolve function for promise (to chain)    
                console.log('Model data parsed..')
                return resolve()
        }) // end Promise executor function

    }; // parseData()

